var header = {"html":"<p>I'm a <a href=\"https://medium.com/chingu/website-builder-vs-web-developer-vs-designer-vs-consultant-6a8de6ffd5f7\">web developer/designer</a> based in Pittsburgh, working primarily with <a href=\"https://hackernoon.com/7-upcoming-nodejs-trends-to-watch-in-2020-6zh32tr\">Node.js</a> and modern <a href=\"https://www.freecodecamp.org/news/making-sense-of-front-end-build-tools-3a1b3a87043b/\">build tools</a> for the <a href=\"https://medium.com/memory-leak/the-jamstack-its-pretty-sweet-e0834e4e6bb7\">JAMstack</a>.</p>","metadata":{},"filename":"header.md","path":"/home/daniel/danielnarey.com/src/app/about/header.md"};

var content = {"html":"<h2 id=\"what-im-working-on\">What I'm Working On</h2>\n<p>Last year, I launched my web design and consulting business, <a href=\"https://metamodern.design\">Metamodern Design Limited</a>. I've been building websites for local clients (<a href=\"https://atlanticgrating.com\">1</a>, <a href=\"https://cook-denomebail.com\">2</a>) and developing <a href=\"https://github.com/metamodern-design/\">tools and systems</a> to facilitate my work. </p>\n<p>While gaining experience as an independent developer, I'm also seeking a longer-term opportunity that will allow me to grow as part of a technical team and find my niche in a specific developer role.</p>\n<h2 id=\"how-i-got-here\">How I Got Here</h2>\n<p>As someone with an innate curiosity, I'm always looking for the next thing to learn. In my mid-30s, around the time I became a new parent, I was searching for a new career path, and I rediscovered a passion for building things with code. After a couple years focused on skill-building (and parenting), I am ready to take my work to the next professional level.</p>\n<p>Thanks to a string of computer science classes in high school and college, I have a strong command of programming fundamentals. I also gained experience working with data in various forms through my research methods coursework and some <a href=\"https://www.coursera.org/specializations/jhu-data-science\">online data science courses</a>. I've put all of that together with my interest in visual design to become a competent front-end developer, and I'm now working to expand my knowledge so that I can claim the \"full-stack\" label.</p>\n<p>For what it's worth, I hold a bachelor's degree in environmental science and a master's in sociology.</p>","metadata":{},"filename":"content.md","path":"/home/daniel/danielnarey.com/src/app/about/content.md"};

