var content$1 = {"html":"<h2 id=\"design--color-system\">Design &amp; Color System</h2>\n<p>Writing clean and maintainable CSS is still one of the most vexing parts of front-end development. A decade ago, CSS frameworks like <a href=\"https://getbootstrap.com/\">Bootstrap</a> were a big step forward in helping developers create cleaner user interfaces with more reusable components. On the down side, anyone who has tried to customize out-of-the box themes and components knows how frustrating it can be to fight with a framework when trying to override inherited styles and behaviors. As creating a unique visual style becomes even more of a marketing imperative for brands and digital products, new design solutions are required.</p>\n<p>One up-and-coming solution to the customization and maintainability problem is <a href=\"https://tailwindcss.com/\">TailwindCSS</a> — a \"utility-first\" framework that is designed on the principle of <a href=\"https://en.wikipedia.org/wiki/Composition_over_inheritance\">composition over inheritance</a>. In brief,</p>\n<blockquote>\n  <p>Instead of opinionated predesigned components, Tailwind provides low-level utility classes that let you build completely custom designs without ever leaving your HTML. If you're sick of fighting the framework, overriding unwanted styles, and battling specificity wars, Tailwind was made for you.</p>\n</blockquote>\n<p>Importantly, Tailwind is made to be customized.&nbsp;Using JavaScript for configuration, you can start with Tailwind's intelligent defaults and adjust them to generate whatever set of utility classes makes sense for your project. </p>\n<p>To support my web development work, I have been using Tailwind to gradually implement a full-fledged design system. Currently, this system includes size and layout classes based on <a href=\"https://programmingdesignsystems.com/layout/a-short-history-of-geometric-composition/index.html\">proportional relationships</a> and color classes based on the <a href=\"https://en.wikipedia.org/wiki/HSL_and_HSV\">HSL model</a> and the <a href=\"https://personal.utdallas.edu/~melacy/pages/2D_Design/Itten_ColorContrasts/IttenColorContrasts.html\">12-hue color circle</a>. My next step is to create visual documentation for this set of custom utility classes. Finally, I plan to create some prototypes for visual styles and basic UI components that can be reused across projects.</p>\n<h2 id=\"static-site-generatorbundler\">Static Site Generator/Bundler</h2>\n<p>A static site generator is a program (typically a command-line utility) that is executed in a development or staging environment to compile source code and data files into HTML files and other assets. Those files can then be hosted with a bare-bones <a href=\"https://developer.mozilla.org/en-US/docs/Learn/Common_questions/What_is_a_web_server\">HTTP server</a>. Using a static site generator enables developers to make use of modern UI frameworks and templating languages, while helping to keep source code maintainable and versionable. </p>\n<p>Sometimes, \"static\" is thought to mean that the site is HTML-only or not fully interactive. On the contrary, many static sites use client-side JavaScript for page navigation and user interactions, as well as to fetch and process data from REST or GraphQL APIs. \"Static\" refers only to the way web content is stored and accessed on the server. Because static web hosting services like <a href=\"https://www.netlify.com/\">Netlify</a> and <a href=\"https://zeit.co/home\">Zeit Now</a> offer unmatched performance and security at <a href=\"https://en.wikipedia.org/wiki/Freemium\">freemium</a> rates, many developers are migrating existing sites or starting new projects using these services.</p>\n<p>There are many static site generators out there, but I decided to create my own so that I would have a simple utility I could run as a build script with out-of-the-box support for the tools I was already using – <a href=\"http://rollupjs.org/guide/en/\">Rollup</a> for bundling ES6 modules, <a href=\"https://postcss.org/\">PostCSS</a> for processing style rules, and <a href=\"https://pugjs.org/api/getting-started.html\">Pug</a> for rendering templated markup. My goals were to eliminate boilerplate and to allow for progressive configuration starting from intelligent defaults. The current pre-release version is well tested, and it is in use as the build script on several of my sites. Although documentation is still forthcoming, the package can be installed from npm as <a href=\"https://www.npmjs.com/package/@metamodern/static\">@metamodern/static</a>. Once I complete the documentation and finalize configuration options, I will be ready to release v1.0.0. I'm currently working on a few <a href=\"https://github.com/metamodern-design\">site templates</a> with different layouts and navigation styles that use <a href=\"https://github.com/metamodern\">@metamodern</a>/static as the build system.</p>","metadata":{},"filename":"content.md","path":"/home/daniel/danielnarey.com/src/app/projects/content.md"};

