var content$2 = {"html":"<h2 id=\"developer-setup\">Developer Setup</h2>\n<p>Last year, I replaced my old MacBook with an iPad Pro, and I am now able to use it for 99% of what I do as a developer. Keeping my local changes synced with cloud repositories has improved my workflow, and the iPad's Liquid Retina / True Tone display is saving my eyesight. Here's my setup:</p>\n<ul>\n<li><strong>Device:</strong> <a href=\"https://www.apple.com/ipad-pro/specs/\">iPad Pro (11-inch)</a> with <a href=\"https://www.apple.com/smart-keyboard/\">Smart Keyboard Folio</a></li>\n<li><strong>Code editor:</strong> <a href=\"https://www.textasticapp.com/\">Textastic</a></li>\n<li><strong>Git client:</strong> <a href=\"https://workingcopyapp.com/\">Working Copy</a></li>\n<li><strong>Terminal emulator & Mosh/SSH client:</strong> <a href=\"http://www.blink.sh/\">Blink</a></li>\n<li><strong>Remote development server:</strong> <a href=\"https://www.digitalocean.com/products/droplets/\">Digital Ocean Droplet</a> running <a href=\"https://ubuntu.com/server\">Ubuntu 18</a> with <a href=\"https://nodejs.org/en/\">Node.js 12</a> installed ($5/mo. for 1GB memory / 25 GB SSD)</li>\n<li><strong>Git host providers:</strong> <a href=\"https://github.com/\">GitHub</a> for public projects, <a href=\"https://about.gitlab.com/\">GitLab</a> for client work</li>\n<li><strong>Browser dev tools for iOS:</strong> <a href=\"https://apps.apple.com/us/app/inspect-browser/id1203594958\">Inspector</a> - not perfect, but useful to have</li>\n</ul>\n<h2 id=\"code-utilities\">Code Utilities</h2>\n<p>Keeping up with the latest trends in Node.js tooling and evaluating alternate packages/frameworks has helped me to be more productive. By selecting a reliable technology stack, I have been able to successfully automate parts of my development workflow. Here are some of the packages I depend upon the most:</p>\n<h3 id=\"jsnode\">JS/Node</h3>\n<ul>\n<li><strong>Bundler:</strong> <del>Webpack</del> (too much configuration, bloated features/ecosystem) ➔ <del>Parcel</del> (not enough configuration, not stable yet) ➔ <a href=\"http://rollupjs.org/guide/en/\">Rollup</a> - the simplest solution with enough options and plugins for most use cases</li>\n<li><strong>Transpiler:</strong> <a href=\"https://babeljs.io/\">Babel</a> configured with <a href=\"https://babeljs.io/docs/en/babel-preset-env\">preset-env</a>, <a href=\"https://github.com/zloirock/core-js/blob/master/docs/2019-03-19-core-js-3-babel-and-a-look-into-the-future.md\">core-js@3</a>, and \"useBuiltIns\" option set to <a href=\"https://babeljs.io/docs/en/babel-preset-env#usebuiltins-usage\">\"usage\"</a></li>\n<li><strong>Browser targeting:</strong> <a href=\"https://github.com/browserslist/browserslist#queries\">Browserslist</a> configured to \"&gt; 1% in US, last 1 version, not dead\"</li>\n<li><strong>Minifier:</strong> <a href=\"https://terser.org/\">Terser</a></li>\n<li><strong>Linter:</strong> <a href=\"https://eslint.org/\">ESLint</a></li>\n<li><strong>Style guide:</strong> <a href=\"https://github.com/airbnb/javascript\">Airbnb</a></li>\n<li><strong>Test runner:</strong> <a href=\"https://github.com/avajs/ava\">AVA</a></li>\n</ul>\n<h3 id=\"css\">CSS</h3>\n<ul>\n<li><strong>Pre/post processor:</strong> <del>Sass</del> ➔ <del>Stylus</del> ➔ <a href=\"https://postcss.org/\">PostCSS</a></li>\n<li><strong>Syntax:</strong> <del>Stylus</del> ➔ <a href=\"https://github.com/postcss/sugarss\">SugarSS</a></li>\n<li><strong>Framework:</strong> <del>Bootstrap</del> ➔ <del>Bulma</del> ➔ <a href=\"https://tailwindcss.com/\">TailwindCSS</a> customized with a complete <a href=\"https://github.com/metamodern-design/color-system\">HSL color system</a> and proportional size/spacing classes</li>\n</ul>\n<h3 id=\"html\">HTML</h3>\n<ul>\n<li><strong>Template engine:</strong> <a href=\"https://github.com/pugjs/pug#syntax\">Pug</a></li>\n<li><strong>Markdown rendering:</strong> <a href=\"http://markdown-it.github.io/\">Markdown-It</a></li>\n</ul>\n<h2 id=\"cloud-services\">Cloud Services</h2>\n<p>When possible, I choose to use/buy services from companies that place human values and product excellence above the drive for market domination. Here are a few I've been using for a while:</p>\n<ul>\n<li><strong>Web hosting:</strong> <a href=\"https://www.netlify.com/\">Netlify</a></li>\n<li><strong>Email:</strong> <a href=\"https://www.fastmail.com/about/\">Fastmail</a></li>\n<li><strong>Cloud storage:</strong> <a href=\"https://www.pcloud.com/\">pCloud</a></li>\n<li><strong>Streaming music:</strong> <a href=\"https://tidal.com/\">TIDAL</a></li>\n</ul>\n<h2 id=\"other-software\">Other Software</h2>\n<p>These considerations also inform my software uses:</p>\n<ul>\n<li><strong>Web browser:</strong> <a href=\"https://www.mozilla.org/en-US/firefox/browsers/\">Firefox</a> - on all of my devices</li>\n<li><strong>Vector illustration:</strong> <a href=\"https://affinity.serif.com/en-us/designer/ipad/\">Affinity Designer</a></li>\n<li><strong>Photo editing:</strong> <a href=\"https://affinity.serif.com/en-us/photo/ipad/\">Affinity Photo</a></li>\n</ul>","metadata":{},"filename":"content.md","path":"/home/daniel/danielnarey.com/src/app/uses/content.md"};

