var content$3 = {"html":"<p><em>1/25/20</em></p>\n<h3 id=\"family\">Family</h3>\n<p>With our son now approaching his third birthday, every waking moment is <a href=\"https://www.youtube.com/user/twentytrucks\">trucks</a> and <a href=\"https://www.youtube.com/watch?v=LI-GA-tkajI\">construction</a>!</p>\n<h3 id=\"reading\">Reading</h3>\n<p>Almost done with Haruki Murakami's <a href=\"http://www.harukimurakami.com/book/killing-commendatore-2\">Killing Commendatore</a>. I've read most of his novels and this one doesn't disappoint – it seems closer to his earlier novels than his more recent ones in character and plot development.</p>\n<h3 id=\"music\">Music</h3>\n<p>Digging <a href=\"https://open.spotify.com/album/2zSAVheEFBPMuUozd6C9gt\">Bill Evans</a>, once again. Recently discovered his <a href=\"https://open.spotify.com/album/7oviEOBGFIC09QpiWRnyFF\">collaboration with Tony Bennett</a> – beautiful arrangements of some less-often-covered standards.</p>\n<p>Meditating on Maurice Ravel's unfathomably intricate <a href=\"https://open.spotify.com/album/66ZlwcSXFuzedj7X18rCLI\">piano compositions</a>.</p>\n<p>Appreciating the masterful songwriting in Bruce Springsteen's <a href=\"https://open.spotify.com/album/6BhqPpIgY83rqoZ2L78Lte\">Western Stars</a>.</p>\n<h3 id=\"podcasts\">Podcasts</h3>\n<p>Keeping up on debates in progressive politics with <a href=\"https://www.vox.com/ezra-klein-show-podcast\">The Ezra Klein Show</a>. </p>\n<h3 id=\"streaming-tv\">Streaming TV</h3>\n<p>Blown away by the thoughtful adaptation and high production quality Amazon's limited series <a href=\"https://www.amazon.com/Philip-K-Dicks-Electric-Dreams/dp/B075NTXMN9\">Philip K. Dick's Electric Dreams</a>.</p>","metadata":{},"filename":"content.md","path":"/home/daniel/danielnarey.com/src/app/now/content.md"};

